Moving the training apis into a namespace of its own. Training APIs can be called by first getting the training api struct and then invoking the calls on that struct.

```c
// shared core APIs
const OrtApi* g_ort_api = OrtGetApiBase()->GetApi(ORT_API_VERSION);

// training APIs
const OrtTrainingApi* g_ort_training_api = OrtGetApiBase()->GetTrainingApi(ORT_API_VERSION);

```

Fix #12040. This PR removes most of the `opset` uses in C# test code. The only use of `opset` now is to workaround a special filename only used in a `opset9` test.
```C#
if (onnxModelFileName.Contains("opset9") && onnxModelFileName.Contains("LSTM_Seq_lens_unpacked"))
  {
    Console.WriteLine($"Change data folder's pattern for LSTM_Seq_lens_unpacked in opset 9.");
    testDataDirNamePattern = "seq_lens*"; // discrepancy in data directory
}
```
After this PR, we can expose `opset` from `InferenceSesson` and completely remove `opset` in C# test code; for example,
```C#
if (session.GetOpSet("onnx") == 9 && onnxModelFileName.Contains("LSTM_Seq_lens_unpacked"))
  {
    Console.WriteLine($"Change data folder's pattern for LSTM_Seq_lens_unpacked in opset 9.");
    testDataDirNamePattern = "seq_lens*"; // discrepancy in data directory
}

```
It also adds a new environment variable to define model path to test Nuget packages, so it's more explicit to see where the test models come from.

Notice that we need to pass a param named "logid" when creating env, then using the env create a new session, so here comes the question:
what if I pass the same logid to create 2 different sessions?
Like, in function foo1, g_ort1->CreateEnv(ORT_LOGGING_LEVEL_WARNING, "model0", &env);
in function foo2, g_ort2->CreateEnv(ORT_LOGGING_LEVEL_WARNING, "model0", &env);
Will such operation lead to crash? In my test nothing happend, but I'm afraid something may happend in the futrue if I don't quite understand the meaning of logid.
Thanks for reading here!

**Describe the bug**
I get a segmentation fault when running a small C++  code at the moment where `session.Run` is called.

**Urgency**
Needs a way to run this code in the next two weeks.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MacOS 12.4 M1
- ONNX Runtime installed from (source or binary): binary
- ONNX Runtime version: 1.11.1 (universal build)

Also with:
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): MacOS 12.4 M1
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: commit number a9b9c7f69f8804f4390ee22008d3c21a40a22f53
- GCC/Compiler version (if compiling from source): Apple clang version 13.1.6 (clang-1316.0.21.2.5)

**To Reproduce**
```
#include "onnxruntime_cxx_api.h"

int main(int argc, char* argv[]) {
    std::string name("model.onnx");
    Ort::Env env(OrtLoggingLevel::ORT_LOGGING_LEVEL_INFO, "clustering");
    Ort::SessionOptions sessionOptions;
    
    sessionOptions.SetIntraOpNumThreads(4);
    sessionOptions.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);
    
    Ort::Session session(env, this->name.c_str(), sessionOptions);
    Ort::AllocatorWithDefaultOptions allocator;
    size_t num_input_nodes = session.GetInputCount();
    size_t num_output_nodes = session.GetOutputCount();
    std::vector<const char*> input_node_names(num_input_nodes);
    std::vector<const char*> output_node_names(num_output_nodes);
    std::vector<int32_t> input_ids_v{0, 33600, 31, 2};
    std::vector<int32_t> attention_mask_v(input_ids_v.size(), 1);
    std::vector<int32_t> token_type_ids_v(input_ids_v.size(), 0);
    Ort::MemoryInfo memory_info = Ort::MemoryInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
    std::vector<int64_t> input_node_dims = {1, static_cast<int64_t>(input_ids_v.size())};
    Ort::Value input_ids = Ort::Value::CreateTensor<int32_t>(memory_info, input_ids_v.data(), input_ids_v.size(), input_node_dims.data(), input_node_dims.size());
    Ort::Value attention_mask = Ort::Value::CreateTensor<int32_t>(memory_info, attention_mask_v.data(), attention_mask_v.size(), input_node_dims.data(), input_node_dims.size());
    Ort::Value token_type_ids = Ort::Value::CreateTensor<int32_t>(memory_info, token_type_ids_v.data(), token_type_ids_v.size(), input_node_dims.data(), input_node_dims.size());
    std::vector<Ort::Value> input_values_v;
    input_values_v.push_back(std::move(input_ids));
    input_values_v.push_back(std::move(attention_mask));
    input_values_v.push_back(std::move(token_type_ids));
    const Ort::Value input_values = Ort::Value::CreateSequence(input_values_v);
    
    for (int i = 0; i < num_input_nodes; i++) {
        char* input_name = session.GetInputName(i, allocator);
        input_node_names[i] = input_name;
    }
    
    for (int i = 0; i < num_output_nodes; i++) {
        char* output_name = session.GetOutputName(i, allocator);
        output_node_names[i] = output_name;
    }
    
    std::vector<Ort::Value> sentence_embedding = session.Run(Ort::RunOptions{nullptr}, input_node_names.data(), &input_values, input_values_v.size(), output_node_names.data(), output_node_names.size());
    
    return 0;
}
```

**Expected behavior**
Having a result.

Is-there anything wrong in what I'm doing?

